import {
  Button,
  Typography,
  Grid
} from "@mui/material";
const Signup = ()=>{
  const design = (
    <>
    <Grid container>
      <Grid item>
        <img src="images/auth.svg" alt="auth" width="100%"/>
      </Grid>
      <Grid item>
      <Typography variant="h1">
        Register
      </Typography>
      </Grid>
    </Grid>

    </>
  );
  return design;
}
export default Signup;
